DROP TABLE IF EXISTS `game_order_mg`;
CREATE TABLE `game_order_mg`  (
                                  `id` int(10) NOT NULL AUTO_INCREMENT,
                                  `tid` int(10) NULL DEFAULT NULL COMMENT '客户id',
                                  `betUID` varchar(50) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL COMMENT '注单号',
                                  `createdTime` datetime(0) NULL DEFAULT NULL COMMENT '注单创建时间',
                                  `gameStartTime` datetime(0) NULL DEFAULT NULL COMMENT '下注开始时间',
                                  `gameEndTime` datetime(0) NULL DEFAULT NULL COMMENT '下注结束时间',
                                  `playerId` varchar(30) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL COMMENT '玩家编号',
                                  `productId` varchar(10) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL COMMENT '产品编号',
                                  `productPlayerId` varchar(30) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL COMMENT '个别产品玩家id',
                                  `platform` varchar(10) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL COMMENT '游戏平台',
                                  `gameCode` varchar(50) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL COMMENT '游戏代码',
                                  `currency` varchar(10) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL COMMENT '货币码',
                                  `betAmount` int(10) NULL DEFAULT NULL COMMENT '下注金额',
                                  `payoutAmount` int(10) NULL DEFAULT NULL COMMENT '派彩金额',
                                  `betStatus` varchar(10) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL COMMENT '投注状态',
                                  `externalTransactionId` varchar(30) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL COMMENT '交易id',
                                  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 157 CHARACTER SET = latin1 COLLATE = latin1_swedish_ci ROW_FORMAT = Dynamic;

ALTER TABLE `game_order_mg`
    ADD COLUMN `game_id` int(10) NULL COMMENT '游戏类型Id' AFTER `betUID`;






